<template>
  <div id="dashboard">
    <v-container class="fill-height" fluid>
      <v-row align="center" justify="center">
        <v-col cols="10" sm="4">
          <v-text-field
            append-icon="search"
            autofocus
            hide-details
            label="Search"
            single-line
            solo
            v-model="searchText"
          ></v-text-field>
        </v-col>
        <v-col cols="5" sm="3">
          <v-btn @click="fetchData" color>
            <v-icon left>replay</v-icon>Refresh
          </v-btn>
        </v-col>
        <v-col class="text-right" cols="5" sm="3">
          <v-btn @click="logout" color="red" dark>Logout</v-btn>
        </v-col>
        <v-col cols="10">
          <v-data-table
            class="elevation-1"
            :fixed-header="true"
            :headers="headers"
            :items="items"
            :loading="isLoading"
            :search="searchText"
          >
            <template v-slot:item.welcome_kit="{ item }">
              <div
                :class="[ item.welcome_kit == 'already received' ? 'green--text' : 'red--text']"
              >{{item.welcome_kit}}</div>
            </template>
            <template v-slot:item.liability="{ item }">
              <v-icon @click="createPDF(item)">save_alt</v-icon>
              <!-- <div class="caption">coming soon...</div> -->
            </template>
          </v-data-table>
        </v-col>
      </v-row>
    </v-container>
  </div>
</template>

<script>
import * as firebase from 'firebase/app'
import 'firebase/firebase-auth'
import JsPDF from 'jspdf'
export default {
  name: 'dashboard',
  data () {
    return {
      searchText: '',
      headers: [
        {
          text: 'ID',
          align: 'left',
          sortable: false,
          value: 'id'
        },
        { text: 'Name', value: 'name' },
        { text: 'Team', value: 'team' },
        { text: 'Country', value: 'country' },
        { text: 'Number', value: 'number' },
        { text: 'Accept Date', value: 'accept_date' },
        { text: 'Welcome Kit', value: 'welcome_kit' },
        { text: 'Liability', value: 'liability' }
      ],
      items: [],
      isLoading: false
    }
  },
  computed: {
    date () {
      var d = new Date()
      return `(${d.getDate()}/${d.getMonth()}/${d.getFullYear()})`
    }
  },
  mounted () {
    this.fetchData()
  },
  methods: {
    createPDF ({ name }) {
      let fontContent =
        ''
      let fontSignature =
        ''
      let pdfName = 'Tipco_Asphalt-Colas_Liability'
      var doc = new JsPDF()

      doc.setFontSize(20)
      doc.setFontType('bold')
      doc.text(72, 20, 'Tipco Asphalt-Colas')
      doc.text(66, 30, 'Asia-Oceania Cup 2019')
      doc.text(58, 40, 'Liability Waiver and Release')

      doc.setFontSize(14)
      doc.setFontType('bold')
      doc.text(10, 55, 'Name :')

      doc.addFileToVFS('Sarabun-Regular.ttf', fontContent)
      doc.addFont('Sarabun-Regular.ttf', 'Sarabun-Regular', 'normal')
      doc.setFont('Sarabun-Regular', 'normal')
      doc.setTextColor(0, 0, 255)
      doc.text(30, 55, name) // playerName

      doc.setTextColor(0, 0, 0)
      doc.text(10, 65, 'Sport selected: 5-A-Side-Soccer')

      doc.text(10, 80, 'Pursuant to my registration and participation in the event called')
      doc.text(10, 88, '"Tipco Asphalt-Colas Asia-Oceania Cup 2019":')

      doc.text(
        20,
        103,
        '\u2022' +
          ' I hereby waive and release the organizer and the co-organizer from any liability'
      )
      doc.text(
        24,
        111,
        'in the event of a physical or medical accident caused to me or to a third party'
      )
      doc.text(24, 119, 'during the course of the activity (ies) for which I am not registered;')

      doc.text(
        20,
        133,
        '\u2022' + ' I assume full liability in the event of a physical or medical accident,'
      )
      doc.text(24, 140, 'caused to myself or to a third party.')

      doc.text(10, 154, 'I hereby declare that I have read and understood this document entitled')
      doc.text(
        10,
        162,
        '"Liability Waiver and Release", that I fully understand it and that I have signed it freely'
      )
      doc.text(
        10,
        170,
        'and voluntarily. I understand that by signing the said Liability Waiver and Release,'
      )
      doc.text(
        10,
        178,
        'Agreement, I hereby waive, on my own behalf and on behalf of my heirs and all other'
      )
      doc.text(
        10,
        186,
        'assignees , the right to sue the organizer and the co-organizer as well as the right'
      )
      doc.text(
        10,
        194,
        'to claim civil damages for any injuries that may occur during my participation in'
      )
      doc.text(10, 202, 'the sporting event called "Tipco Asphalt-Colas Asia-Oceania Cup 2019".')

      doc.text(10, 221, 'Signed at Bangkok, Thailand')
      doc.text(10, 229, `On ${this.date}`) // date

      doc.addFileToVFS('Sriracha-Regular.ttf', fontSignature)
      doc.addFont('Sriracha-Regular.ttf', 'Sriracha-Regular', 'normal')
      doc.setFont('Sriracha-Regular', 'normal')
      doc.setTextColor(0, 0, 255)
      doc.setFontSize(24)
      doc.text(10, 245, name) // signature

      doc.setFont('Sarabun-Regular', 'normal')
      doc.setFontSize(10)
      doc.setTextColor(0, 0, 0)
      doc.text(10, 255, `(${name})`)
      doc.save(pdfName + '.pdf')
    },
    async fetchData () {
      try {
        this.items = []
        this.isLoading = !this.isLoading
        const response = await this.axios.get(`https://sheetdb.io/api/v1/92u4gqslzu1bk`)
        this.items = response.data
        this.isLoading = !this.isLoading
      } catch (error) {
        throw new Error(error)
      }
    },
    logout () {
      if (confirm('Are you sure to loggout ?')) {
        firebase
          .auth()
          .signOut()
          .then(() => {
            this.$router.replace('login')
          })
      }
    }
  }
}
</script>

<style lang="scss" scoped>
@import url('https://fonts.googleapis.com/css?family=Sriracha&display=swap');
</style>
